import '../styles/login.css';
import { SmallTitle } from '../components/title';

export default function Login() {
    return (
        <div className="login-container">
            <div className="login-top">
                <div className="login-logo">
                </div>
            </div>
            <SmallTitle />
        </div>
    )
}
